import React from 'react';
import "./delivery-item.css"

const DeliveryItem = ({item}) => {
  return (
    <div>
        <div className="delivery-item-cover">
        <img src={item.cover}
        className="delivery-item-image"
        alt={item.title}>
        </img>
        </div>
        <div className='delivery-item'><h1></h1></div>
        </div>
  );
};

export default DeliveryItem;
